function clean(addr){
  return addr.trim().replace(/\s+/g,'').toLowerCase();
}

function checkEligibility(){
  const wallet = clean(document.getElementById("wallet").value);
  const result = document.getElementById("result");

  if(gtdlist.map(clean).includes(wallet)){
    result.innerHTML="üéü You have a GTD Spot!";
    result.style.color="#00ccff";
    return;
  }

  if(whitelist.map(clean).includes(wallet)){
    result.innerHTML="‚úÖ You are Whitelisted!";
    result.style.color="#00ff99";
    return;
  }

  result.innerHTML="‚ùå Not Eligible";
  result.style.color="red";
}

//////////////////////////////////////////////////////
// 3 PHASE MINT TIMES (UTC)
//////////////////////////////////////////////////////

const gtdDate = new Date("March 4, 2026 15:00:00 UTC");
const wlDate = new Date("March 4, 2026 16:00:00 UTC");
const publicDate = new Date("March 4, 2026 17:00:00 UTC");

function getTimeRemaining(date){
  const now = new Date();
  const diff = date - now;

  if(diff <= 0){
    return "üöÄ LIVE";
  }

  const days = Math.floor(diff/(1000*60*60*24));
  const hours = Math.floor((diff%(1000*60*60*24))/(1000*60*60));
  const minutes = Math.floor((diff%(1000*60*60))/(1000*60));
  const seconds = Math.floor((diff%(1000*60))/1000);

  return `${days}d ${hours}h ${minutes}m ${seconds}s`;
}

function updateCountdown(){
  document.getElementById("gtdTimer").innerHTML = getTimeRemaining(gtdDate);
  document.getElementById("wlTimer").innerHTML = getTimeRemaining(wlDate);
  document.getElementById("publicTimer").innerHTML = getTimeRemaining(publicDate);
}

setInterval(updateCountdown,1000);
updateCountdown();
